import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import "./list.css";

const ImageList = () => {
  const [imageData, setImageData] = useState([]);
  const navigate = useNavigate();


  useEffect(() => {
    fetchImageData();
  }, []);

  const fetchImageData = async () => {
    try {
      const response = await fetch('http://10.2.8.173:5000/getImagesUploadDetailsByUsername', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
        //   user: localStorage.getItem('userEmail')
          user: "null"
        })
      });
      console.log(response.status);
      const data = await response.json();
      console.log('Image data fetched successfully:', data);
      setImageData(data.reverse());
    } catch (error) {
      console.error(error);
    }
  };

  const handleViewClick = (requestID) => {
    // Handle view button click for the corresponding request ID
    // ...
  };

  const handleAnnotateClick = (requestID) => {
    // Handle annotate button click for the corresponding request ID
    navigate(`/imageannotation/${requestID}`);
  };

  const handleDeleteClick = (requestID) => {
    // Handle delete button click for the corresponding request ID
    // ...
  };

  return (
    <div className="ImageList">
      <table>
        <thead>
          <tr>
            <th>Upload Day Date Time</th>
            <th>Label</th>
            <th>Total Images</th>
            <th>Total Annotated Images</th>
            <th>Total Unannotated Images</th>
            <th>Status</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {imageData.map((image) => (
            <tr key={image.requestID}>
              <td>{image['Upload DateTime']}</td>
              <td>{image.Label}</td>
              <td>{image['Total Images']}</td>
              <td>{image['Total Annotated Image']}</td>
              <td>{image['Total Unannotated Image']}</td>
              <td>{image.Status}</td>
              <td>
                <button className="view-button" onClick={() => handleViewClick(image.requestID)}>View</button>&nbsp;&nbsp;
                <button className="annotate-button" onClick={() => handleAnnotateClick(image.requestID)}>Annotate</button>&nbsp;&nbsp;
                <button className="delete-button" onClick={() => handleDeleteClick(image.requestID)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ImageList;
